import React, { useEffect, useState } from 'react';
import { SlideShow } from './SlideShow';
import axios from 'axios';
import { HomeItemList } from './HomeItemList';

export default function App() {
  const [banners, setBanners] = useState([]);
  const [dataSection, setDataSection] = useState([]);
  useEffect(()=>{
    axios.get('https://photo.azurecloud.vn/api/v1/banners/list-banner-active')
    .then(data=>{
      console.log(data.data.data.banners.data);
      let b = data.data.data.banners.data;
      
      setBanners(b);
    })

    axios.get('https://photo.azurecloud.vn/api/v1/businesses/featured-screen-home-mobile')
    .then(response=>{
     setDataSection(response.data.data.dataSection);
    })

  },[]);
  return (
    <div>
      <SlideShow banners={banners}></SlideShow>
      {
        dataSection.map((section, index)=>(
          <HomeItemList title={section.header} ></HomeItemList>
        ))
      }
     

    </div>
   
  );
}
